  }
  return (
    <>
      <div className="container mt-5  ">
        <div className="row">
          <div className="col-xl-3"></div>
          <div className="col-xl-6">
            <table className='table table-hover'>
              <thead>
                <tr>
                  <th className='col'>Categores</th>
                </tr>
              </thead>
              <tbody>
