                  categories.map(element => {
                    return < tr>
                      <Link className='nav-link' to={element}>{element}</Link>
                    </tr>
                  })
                }
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </>
  )
}

export default Categore
